import { Component } from 'react';








class Tag_page extends Component {
    constructor(props){
        
        super(props);
        
        this.state = {
            page:this.props.newpage,
            questions:model.getAllQstns().sort((a, b) => b.askDate - a.askDate),
            tags:model.getAllTags(),
            active:null,
            unanswer:[]
        }
    }
}

export default Tag_page;
